// import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="app">
      <div>
       <p className="warning"><i>this site is under construction, but it welcomes all visitors :)</i></p>
      </div>
      <div className="header">
        <h3>Eva Lau is a printmaker, painter, and textile artist. Mainly, however, she likes making things.</h3>
      </div>

    </div>
  );
}

export default App;
